CREATE database IF NOT EXISTS ra_animes DEFAULT CHARACTER SET utf8 COLLATE utf8_spanish2_ci;
-- -----------------------------------------------------

USE ra_animes;

-- -----------------------------------------------------
-- Table ra_animes.animes_links_mal
-- -----------------------------------------------------

-- DROP TABLE ra_animes.animes_links_mal;

CREATE TABLE ra_animes.animes_links_mal (
  id int(11) UNSIGNED AUTO_INCREMENT NOT NULL COMMENT 'Identificador unico del LINK.',
  corto varchar(45)  NOT NULL COMMENT 'Link Corto.',
  codigo int(11) UNSIGNED NOT NULL COMMENT 'Codigo del Link.',
  extra varchar(150) NOT NULL COMMENT 'Link Corto.',
  largo varchar(500) NOT NULL COMMENT 'Link Largo.',
  erased tinyint(1) NOT NULL DEFAULT 1 COMMENT 'Mantiene el borrado logico del sistema.',
  create_at timestamp NOT NULL DEFAULT current_timestamp() COMMENT 'Registra la creacion del campo.',
  update_at timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Registra la ultima actualizacion del campo.',
  PRIMARY KEY (id),
  UNIQUE INDEX link_corto_unique (corto),
  UNIQUE INDEX link_largo_unique (largo),
  UNIQUE INDEX codigo_unique (codigo)
)
ENGINE=InnoDB 
DEFAULT CHARSET=utf8
COLLATE=utf8_spanish2_ci
COMMENT='Registra los link de MyAnimelist de cada anime, separandolo codigo, el link sin nombre, con nombre y por nombre';

COMMIT;

